import React, { useState, useEffect } from 'react';
import axios from 'axios';

const OsobaList = () => {
    const [osoby, setOsoby] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8080/osoba')
            .then(response => setOsoby(response.data))
            .catch(error => console.error('Błąd pobierania danych: ', error));
    }, []);

    return (
        <div>
            <h2>Lista Osób</h2>
            <ul>
                {osoby.map(osoba => (
                    <li key={osoba.id}>
                        {osoba.imie} {osoba.nazwisko} - ID: {osoba.id},
                        Data urodzenia: {osoba.dataUrodzenia},
                        Numer telefonu: {osoba.numerTelefonu ? osoba.numerTelefonu.numer : 'Brak'},
                        Adres: {osoba.adres ? `${osoba.adres.ulica} ${osoba.adres.miasto}` : 'Brak'},
                        Praca: {osoba.praca ? osoba.praca.nazwa : 'Brak'}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default OsobaList;
